import React from 'react'
import './UnitsList.css'

const UnitsList = (props) => {

  return (
    <tbody className='tbody'>
      <tr>
        <td>{props.id}</td>
        <td>{props.name}</td>
        <td>{props.age}</td>
      </tr>
    </tbody>
  );
};

export default UnitsList;
